	(553, 1, 188, 'From Sungrow: I checked the system and updated all firmware to the latest for you.\r\n\r\nThere is a large voltage deviation between the top module and the remaining modules so a service job is needed to balance the top module manually. You just need to charge the whole stack to exact 100%, then take the top module off, discharge a little bit and charge the remaining 4-module stack to 100% again. Finally put the top module back. By doing that the top module will be on the same battery level with other modules.', '2024-08-08 14:39:35', '2024-08-08 14:39:35'),
	(554, 1, 188, 'From Sungrow: The service rebate is the same as replacing a battery module. Please use the link below for lodging a warranty claim of manual balancing the top module. You don’t need the reference number but please reply to me with the warranty reference number after lodging.\r\n<br><br>\r\nhttps://service.sungrowpower.com.au/Warranty/online-warranty-claim-form', '2024-08-08 14:39:48', '2024-08-08 14:39:48'),
