	(725, 1, 261, 'Ahsan from SAJ: <br><Br>\r\nI visited the site today and discovered that the installer had made a joint in the CT wire, as the customer\'s main and sub boards are located on different levels. I attempted to locate the CTs on both the main electrical board and the sub board, but was unable to find them. I have taken some pictures and videos for reference, which are attached. Additionally, there is another SAJ inverter installed on-site with the same issue. The installer needs to check that as well. Thanks', '2024-10-14 14:41:24', '2024-10-14 14:41:24'),
	(726, 1, 261, 'Asked Steph to send SAJ back to fix the issue and show the photos and video.', '2024-10-14 14:41:43', '2024-10-14 14:41:43'),
	(727, 1, 263, 'From ALAN: <br><br>\r\nThe system CT looks all right for us. However, it looks like that the firmware of this inverter need to be updated to enable the export. There will be power cut at the back-up during the firmware update for about 10 minutes', '2024-10-15 11:17:38', '2024-10-15 11:17:38'),
