	(850, 1, 297, '<strong>From Ahsan</strong>\r\nI visited the site today and suspect that the control box may be faulty, as it is not allowing DC voltage from the battery module to pass through to the inverter. Consequently, the inverter cannot detect the DC voltage. I will need to replace the control box and revisit the site. This has been communicated to the customer. I will update you once the replacement is completed. Thank you.', '2024-11-19 12:52:50', '2024-11-19 12:52:50'),
