	(855, 1, 272, 'firmware was updated by the manufacturer. issue is possibly fixed. Client is monitoring.', '2024-11-22 10:59:37', '2024-11-22 10:59:37'),
	(856, 1, 290, 'From the conversation I had with the installer, it seems the 24V power supply on the meter end has failed. 0V was measured across its output terminals. Because of this, the bridge unit is not receiving any power, but nothing seems to be wrong with it specifically. Everything on the inverter end appears to be working correctly. According to the installer, the system was operating fine until a few weeks ago. I would assume this is when the power supply failed. The power supply in use is the Meanwell HDR-30-24, and it can be replaced with any 24V power supply with at least 1A DC output.\r\n\r\n \r\n\r\nAs this kit was purchased under a year ago, we will be honouring a warranty replacement of the power supply. Please provide a delivery address, and I’ll prepare a replacement to be sent out. Swapping a new power supply with the failed one will almost certainly resolve the situation. If possible, it would be helpful if the failed power supply could be returned to us, so that testing for the specific fault can be carried out.', '2024-11-22 13:39:03', '2024-11-22 13:39:03'),
