	(554, 1, 188, 'From Sungrow: The service rebate is the same as replacing a battery module. Please use the link below for lodging a warranty claim of manual balancing the top module. You donÃ¢â‚¬â„¢t need the reference number but please reply to me with the warranty reference number after lodging.\r\n<br><br>\r\nhttps://service.sungrowpower.com.au/Warranty/online-warranty-claim-form', '2024-08-08 14:39:48', '2024-08-08 14:39:48'),
