	(690, 1, 71, 'From Saj:\r\n<br><br>\r\nI attended a site service call where the system was not functioning as expected. Upon logging into my SolarEdge installer account to check the inverter data, I found that only 14 out of 16 optimizers were reporting. We then attempted to re-pair the optimizers in an effort to connect all of them; however, only 14 optimizers continued to report after the pairing process.\r\nWe proceeded to test the voltage at various points, and the readings fluctuated between 9V and 19V at different times.<br><br>\r\nAfter contacting SolarEdge technical support, I spoke with a technician who guided me through several testing procedures. Based on these tests, it was suggested that the issue could either be a faulty optimizer or faulty wiring, which will require further investigation.<br><br>\r\nRecommendations:\r\nFurther investigation is required to pinpoint the cause of the issue, focusing on the possibility of a faulty optimizer or wiring. Additional support from SolarEdge may be needed if the issue remains unresolved following further inspection.<br><br>', '2024-09-25 11:00:00', '2024-09-25 11:00:00'),
	(691, 1, 242, 'SAJ advised that there\'s a possible CT installation issue. because of the export during night time.', '2024-09-30 09:19:28', '2024-09-30 09:19:28'),
	(692, 1, 242, 'From SAJ: We are sorry it took so long, We found out a problem. In the evening, the background data of the inverter shows that there is an export power. We suspect that it is caused by the reverse direction of CT, Please provide the photos of CT orientation on the spot, so that we can better analyze the problem, thanks.', '2024-09-30 09:19:59', '2024-09-30 09:19:59'),
	(693, 1, 247, 'The systems settings was set to VPP, so I changed it to timed mode and it rectified the battery not detected issue.', '2024-09-30 10:50:02', '2024-09-30 10:50:02'),
	(694, 1, 222, 'Manufacturer is asking for the following information:<br><br><br>\r\n\r\nPhoto of the installation (including surrounding area of the installation)<br>\r\nPhoto of the Name Plate with serial number (including surrounding area of the installation)<br>\r\nOriginal Payment Invoice (Wholesaler\'s Invoice)<br>\r\nCompleted RMA Form (attached)', '2024-10-01 14:33:25', '2024-10-01 14:33:25'),
