	(757, 1, 239, 'I spoke with Trent, and he mentioned that everything is working fine now. He also said he doesnÃ¢â‚¬â„¢t need the system connected to the internet and doesnÃ¢â‚¬â„¢t want to spend extra on extenders. \r\n\r\nIn short, theyÃ¢â‚¬â„¢re fine without online monitoring as long as the system is functioning properly. Trent agreed to reach out if any issues arise, though I did explain the importance of online monitoring for future reference or troubleshooting. However, he\'s content with the current setup.', '2024-10-21 14:28:16', '2024-10-21 14:28:16'),
	(758, 1, 243, 'Se\r\nCould you please check with him if the heating is connected to the main circuit board and if the client is on Tariff 93? Will the heating draw power from the battery, even if it\'s not part of the UPS/EPS circuit?<br><br>\r\n\r\n I understand that heating is typically not connected to the EPS, but will the battery still supply power when the heating is in use during normal operation?<br><br>\r\n\r\nI remembered we have the same case like this at 52 Waldhorn Drive, Grindelwald which the heating is connected if the client is in Tariff 93.<br><br>', '2024-10-21 14:54:22', '2024-10-21 14:54:22'),
	(759, 1, 244, 'Sent a followup email to SAJ', '2024-10-21 14:57:44', '2024-10-21 14:57:44'),
	(760, 1, 245, 'Sent an email to client about a settings updated by the manufacturer and his system is working correctly. No update from the client so will close this ticket.', '2024-10-21 15:04:38', '2024-10-21 15:04:38'),
	(761, 1, 246, 'Still no update from client so closing the ticket.', '2024-10-21 15:05:44', '2024-10-21 15:05:44'),
	(762, 1, 253, 'sent to <b>Jack G.</b> <br><br>Simon Hill, from a previous installation at 4B Lowther St, MALDON VIC 3463, has reported that he is unable to view consumption and export data on his online monitoring. Upon investigation, it was found that a smart meter had been installed.<br><br>\r\n\r\nThe manufacturer has confirmed that the smart meter is offline and requires a manual inspection to identify any potential wiring issues.  <br><br>\r\n\r\nCould you please arrange a date to have the smart meter inspected and the connection issue rectified?<br>', '2024-10-21 15:14:20', '2024-10-21 15:14:20'),
	(763, 1, 254, 'Alan Atkinson\'s solar system has been stuck in "OFF MODE," and despite several attempts to guide him through switching it back to "START" mode, we\'ve been unable to resolve the issue.<br><br>The instructions provided by FoxESS Kim differ slightly from the ones we have, and this has caused further confusion. While Kim tried to reach out to Alan, he was not able to take the call.<br><br>Alan has expressed his frustration with the system and mentioned escalating the issue to VCAT or Consumer Affairs within 2-3 days if it isn\'t fixed. HeÃ¢â‚¬â„¢s also been vocal about his dissatisfaction with the system and has reportedly shared his negative experience within his community.<br><br>Additionally, Alan referred to a solicitor and brought up the promise to replace a glass panel, which he feels has not been fulfilled.<br><br>After relaying this to Adam, I was instructed to send a guide. However, Alan has refused to follow the guide, stating that he no longer wishes to interact with the system and is now insisting that a technician be sent.<br><br>We\'ve already tried walking him through the process several times on the phone without success. There has also been some miscommunication between Alan and Kim during troubleshooting.<br><br>At this point, I\'m awaiting further instructions on how to proceed.', '2024-10-21 15:21:24', '2024-10-21 15:21:24'),
	(764, 1, 261, 'Sent a followup email to Sajneel', '2024-10-21 16:12:47', '2024-10-21 16:12:47'),
	(765, 1, 262, 'System was successufully reconnected to their router.', '2024-10-21 16:13:20', '2024-10-21 16:13:20'),
	(766, 1, 266, 'Performed firmware update today. I will check tomorrow if the firmware update rectifies the issue.', '2024-10-21 16:40:23', '2024-10-21 16:40:23'),
	(767, 1, 269, 'Upon checking clients online data, it appears to have a CT/Meter installation issue; the PV and Load movement is identical.', '2024-10-22 09:47:45', '2024-10-22 09:47:45'),
	(768, 1, 271, 'The system was installed on July 15, 2024, inspected on July 24, 2024, and ceased generating power on July 26, 2024, remaining offline until August 14, 2024. <br><br>\r\n\r\nThe battery was flat on August 13, 2024.<br><br>\r\n\r\nWe only recently turned the battery back on a few days ago.<br><br>', '2024-10-22 10:40:02', '2024-10-22 10:40:02'),
	(769, 1, 272, '<p>An update on change of battery management behaviour.</p>\r\n\r\n<p>The graph from the 5th October shows the whole 24 hrs that no power was taken from the grid- the sharp rises in load power easily managed by the battery or solar. This has been the normal behaviour until the last week or so. So probably the new issue is not a latency thing. (EG Sudden change in Load, as this was handled OK on the 5th)</p>\r\n\r\n<p>The 19th October graph shows a different story. Grid power drawn in the middle of the night seems to follow small increases in power probably from the only appliance in the night that may change power drawn. (An inverter driven fridge which uses quite low power when just keeping the temp right.)</p>\r\n\r\n<p>The highlighted example at 9:35 on the 19th Graph shows:-</p>\r\n<ul>\r\n    <li>Load: 2692W</li>\r\n    <li>PV at: 1152W</li>\r\n    <li>Battery discharge: 1246W</li>\r\n    <li>Import power: 276W</li>\r\n</ul>\r\n\r\n<p>Import power seems to peak upwards when a device turns on. For example, the large load increase was the fan in our gas heating and probably our heat pump dryer turning on. IÃ¢â‚¬â„¢ve also observed the light on the inverter that switches to solid, indicating power from the grid from time to time when not required. Sometimes over 1KW is drawn from the grid.</p>\r\n\r\n<p>Clearly, the battery management operation has changed since a week or two ago, and given that the mode of operation should be as per self-consumption mode, this new behaviour could add $100+ to yearly bills and waste battery stored energy. IÃ¢â‚¬â„¢ve also noticed the import change on the AGL account app.</p>\r\n\r\n<p>Hope this information helps the manufacturer with firmware upgrades, as this is a clear change of operation. IÃ¢â‚¬â„¢m very keen for it to be sorted, but understand this is often the nature of software/firmware upgrades when one change affects something else. My background is in the electrical field, so I have some understanding. Generally, IÃ¢â‚¬â„¢m happy with the installation and support.</p>\r\n\r\n<p>Note: So far, the other issue of the backup circuit dropping out has been OK, but IÃ¢â‚¬â„¢m only on the second day since switching to Backup.</p>', '2024-10-22 10:43:35', '2024-10-22 10:43:35'),
	(770, 1, 272, 'An update on change of battery management behaviour.<br><br>\r\n\r\nThe graph from the 5th October shows the whole 24 hrs that no power was taken from the grid- the sharp rises in load power easily managed by the battery or solar. This has been the normal behaviour until the last week or so. So probably the new issue is not a latency thing. (EG Sudden change in Load, as this was handled OK on the 5th)<br><br>\r\n\r\nThe 19th October graph shows a different story. Grid power drawn in the middle of the night seems to follow small increases in power probably from the only appliance in the night that may change power drawn. (An inverter driven fridge which uses quite low power when just keeping the temp right.)<br><br>\r\n\r\nThe highlighted example at 9:35 on the 19th Graph shows:-<br>\r\nLoad: 2692W<br>\r\nPV at: 1152W<br>\r\nBattery discharge: 1246W<br>\r\nImport power: 276W<br><br>\r\n\r\nImport power seems to peak upwards when a device turns on. For example, the large load increase was the fan in our gas heating and probably our heat pump dryer turning on. IÃ¢â‚¬â„¢ve also observed the light on the inverter that switches to solid, indicating power from the grid from time to time when not required. Sometimes over 1KW is drawn from the grid.<br><br>\r\n\r\nClearly, the battery management operation has changed since a week or two ago, and given that the mode of operation should be as per self-consumption mode, this new behaviour could add $100+ to yearly bills and waste battery stored energy. IÃ¢â‚¬â„¢ve also noticed the import change on the AGL account app.<br><br>\r\n\r\nHope this information helps the manufacturer with firmware upgrades, as this is a clear change of operation. IÃ¢â‚¬â„¢m very keen for it to be sorted, but understand this is often the nature of software/firmware upgrades when one change affects something else. My background is in the electrical field, so I have some understanding. Generally, IÃ¢â‚¬â„¢m happy with the installation and support.<br><br>\r\n\r\nNote: So far, the other issue of the backup circuit dropping out has been OK, but IÃ¢â‚¬â„¢m only on the second day since switching to Backup.', '2024-10-22 10:44:05', '2024-10-22 10:44:05'),
