	(828, 1, 243, '<strong>Sent to client:</strong> <br><br>\r\n At the moment, we donÃ¢â‚¬â„¢t have any scheduled work near your area, but we do have projects planned for early next year.<br><br>\r\nWe would be happy to stop by for a check when weÃ¢â‚¬â„¢re in the area. Please note that there may be an additional cost if any wiring work is required.<br><br>\r\n<br><br><br><br>\r\nI will reach out as soon as we have a possible date for the inspection.', '2024-11-13 11:37:45', '2024-11-13 11:37:45'),
	(829, 1, 244, 'SAJ has indicated that there are no issues with the installation, and RedX has confirmed that everything is in order, despite previously suggesting there was a problem.', '2024-11-13 11:56:08', '2024-11-13 11:56:08'),
	(830, 1, 254, 'Peter has confirmed that the issue was becaues of the voltage being too high, which limit the systems performance. <br><br> I called the distributor for confirmation and they confirmed that the voltage went more than 255V which is over the normal range. The distributor has arrange a technician to inspect the clients wiring/grid/meter to resolve the issue. No date yet or confirmation.', '2024-11-13 12:03:16', '2024-11-13 12:03:16'),
