	(852, 1, 298, 'Ahsan said that updating the firmware should resolve the problem. <br><br>I Spoke with the client and gave them all the details. She is content and only needs to keep an eye on the system.', '2024-11-20 11:26:21', '2024-11-20 11:26:21'),
	(853, 1, 288, 'explained to the client that the battery only supplies 1 phase of this three phase. Client needs to engage a local electrician to transfer other circuits to the phase where the battery is connected.', '2024-11-20 11:44:36', '2024-11-20 11:44:36'),
	(854, 1, 302, 'Dongle unbound. Sent email to client', '2024-11-22 10:29:22', '2024-11-22 10:29:22'),
	(855, 1, 272, 'firmware was updated by the manufacturer. issue is possibly fixed. Client is monitoring.', '2024-11-22 10:59:37', '2024-11-22 10:59:37'),
	(856, 1, 290, 'From the conversation I had with the installer, it seems the 24V power supply on the meter end has failed. 0V was measured across its output terminals. Because of this, the bridge unit is not receiving any power, but nothing seems to be wrong with it specifically. Everything on the inverter end appears to be working correctly. According to the installer, the system was operating fine until a few weeks ago. I would assume this is when the power supply failed. The power supply in use is the Meanwell HDR-30-24, and it can be replaced with any 24V power supply with at least 1A DC output.\r\n\r\n \r\n\r\nAs this kit was purchased under a year ago, we will be honouring a warranty replacement of the power supply. Please provide a delivery address, and IÃ¢â‚¬â„¢ll prepare a replacement to be sent out. Swapping a new power supply with the failed one will almost certainly resolve the situation. If possible, it would be helpful if the failed power supply could be returned to us, so that testing for the specific fault can be carried out.', '2024-11-22 13:39:03', '2024-11-22 13:39:03'),
	(857, 1, 306, 'sent acknowledgement email.', '2024-11-25 10:35:30', '2024-11-25 10:35:30'),
	(858, 1, 301, 'I spoke with the client and explained that if the inverter doesn\'t show any alarm, it should be okay. The client still believes that his inverter is way too hot and there\'s something wrong with it. I provided an option to monitor the system but since the system is not connected to the internet, he will arrange for his daughter to assist him with connecting his system to the internet.  Donald will call once they are ready configuring the system.', '2024-11-25 10:41:43', '2024-11-25 10:41:43'),
	(859, 1, 293, 'I spoke with Ali about the system that it has meter but it\'s not reading any data and not exporting. Ali advised that the meter is disabled and it requires to be changed manually on the system. I sent a guide to the client to check and enable it.', '2024-11-25 11:43:09', '2024-11-25 11:43:09'),
