INSERT INTO `tickets` (`id`, `ticket_number`, `user_id`, `the_client`, `installer`, `serial_number`, `title`, `description`, `priority`, `status`, `is_resolved`, `is_locked`, `assigned_to`, `created_at`, `updated_at`, `message`) VALUES
	(1, '032401', 1, 5256, NULL, NULL, 'Inverter and Battery Faulty', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-04 13:30:29', '2024-06-21 04:38:21', 'Sungrow confirmed that the inverter and battery is faulty and approved a replacement.\r\n\r\nThe replacement inverter, battery, and battery MCB have been delivered to the client\'s place.'),
	(3, '032403', 1, 4126, NULL, NULL, ' KStar Inverte approve replacement', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-11 11:19:46', '2024-06-21 04:38:26', 'Inverter is confirmed to be faulty and a replacement has been approved.'),
	(4, '032404', 1, 7267, NULL, NULL, 'Waiting Status and Blank Screen', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-11 11:35:53', '2024-06-21 04:38:32', 'Possibly DC switch is off and the inverter went to standby.'),
	(5, '032405', 1, 5377, NULL, 'AL2002221080564', 'Sample Fault', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-11 11:48:54', '2024-06-21 04:38:40', 'Inverter is confirmed to be replaced and the replacement is estimated to arrive today.\r\n\r\nhttps://www.mainfreight.com/track/MSAUS/55116142871?lang=en-NZ'),
	(6, '032406', 1, 5795, NULL, 'AL7011022100861', 'System performance', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-11 12:02:44', '2025-05-28 08:36:32', 'Joan, Ian Hunter\'s partner, called 12/03/24 and reported that the system is not working correctly.\r\n\r\nNeed to check the system for possible issues.'),
	(7, '032407', 1, 4511, NULL, NULL, 'Breaker keeps tripping', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-11 13:16:03', '2024-06-21 04:37:52', 'Sent a guide to online monitoring to see the error remotely.'),
	(8, '032408', 1, 5403, NULL, NULL, 'Inverter replacement and rectification', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-11 13:18:29', '2024-06-21 04:37:43', 'The inverter needs to be replaced, and the cables on the roof have melted.\r\n\r\nGary Baker has confirmed to do the rectification and inverter replacement for $150+gst.\r\n\r\nWe are still waiting for the inverter replacement. 12/03/2024'),
	(9, '032409', 1, 3807, NULL, NULL, 'AC Voltage Too High', NULL, 'low', 'closed', 0, 0, 13, '2024-03-11 13:46:06', '2025-05-28 08:37:41', 'Client is insisting that the issue is not the the manufacturer.\r\n\r\nSent email to the manufacturer to check the system and give us access to the clients system.'),
	(10, '032410', 1, 7220, NULL, NULL, 'Consumption Too High', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-11 15:01:46', '2024-06-21 04:37:30', 'William reported that they don\'t have any AC and just using normal lights, TV and a fridge and his consumption reaches more than 8KW to 10KW.'),
	(11, '032411', 1, 3477, NULL, NULL, 'Zeversolar Warranty Claim - CA-APAC-00059879', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-12 11:28:59', '2024-06-21 04:37:21', 'To be lodged.\r\n\r\nWaiting for Grants report and photos'),
	(12, '032412', 1, 5056, NULL, NULL, 'Battery faulty', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-12 14:10:22', '2024-06-21 04:36:57', 'The client already received the battery replacement and now waiting for an update from Alpha for the field team to do the replacement.'),
	(13, '032413', 1, 6941, NULL, 'WO100781', 'B3+ Replacement', NULL, 'normal', 'resolved', 0, 0, 2, '2024-03-12 14:14:20', '2024-06-21 04:36:50', 'Alpha has confirmed that the unit needs to be replaced.\r\n\r\nAlpha is now outsourcing installers to do the replacement because our installer Saj is very far from the clients address.'),
	(14, '032414', 1, 6087, NULL, NULL, 'BMS board replacement', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-12 14:19:09', '2024-06-21 04:36:09', 'Due to Bat_overvolt_hardware_fault	found on the clients system, Alpha decided to replace the bms board.\r\n\r\nAlpha is arranging their own tech to do the replacement.'),
	(15, '032415', 1, 4560, NULL, NULL, 'Solis Inverter Replacement', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-12 14:28:41', '2024-06-21 04:35:59', 'The client hired their own technician to do the inspection and installation.\r\n\r\nThe system was replaced between 4 to 8 March and now working.'),
	(16, '032413', 1, 4974, NULL, NULL, 'Inverter and Battery Replacement', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-12 14:37:44', '2025-05-28 08:36:48', 'The inverter and battery replacement arrived, and Leigh, the contractor, has confirmed that he will do the replacement.\r\n\r\nNote; system was replaced like 3 to 4 times already.'),
	(17, '032417', 1, 7171, NULL, NULL, 'System Inspection', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-12 16:06:31', '2024-06-21 04:35:25', 'Client reported that there\'s a fire hazard about the ohms that registering on the app.\r\n\r\nSaj arranged a date to inspect the system - 15-02-24'),
	(18, '032417', 1, 5274, NULL, NULL, 'Solis Inverter Replacement', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-12 16:09:24', '2024-06-21 04:35:15', 'The inverter was soaked in water, and Solis approved a replacement as a good will something hehe.\r\n\r\nSolis arranged for their own subcontractor and replaced the system.'),
	(19, '032419', 1, 2067, NULL, NULL, 'Exposed wire replacement', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-12 16:12:59', '2024-06-21 04:35:02', 'Client reported that a cable from their backup system was cracked and exposed.\r\n\r\nClient paid for a service to replace the cable'),
	(20, '032420', 1, 5512, NULL, 'AL7002223041060', 'EEPROM - Inverter replacement', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-12 16:22:59', '2024-06-21 04:34:38', 'Client had EEPROM error and Alpha confirmed to replace the inverter.'),
	(21, '032421', 1, 5351, NULL, NULL, 'UPS Installation', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-12 16:28:42', '2025-05-28 08:54:17', 'Simon Mibus has confirmed to complete the UPS installation last 26 February.'),
	(22, '032422', 1, 3828, NULL, NULL, 'Zeversolar warranty claim', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-12 16:38:39', '2024-06-21 04:34:15', 'Checklist and photos have been forwarded by the clients subcontractor and already submitted to the manufacturer.'),
	(23, '032423', 1, 7228, NULL, NULL, 'Lost Comm Inverter and Grid Meter', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-12 17:07:01', '2024-06-21 04:34:05', 'Client reported that the battery is not charging and it was confirmed by SAJ tech that it needs to be inspected physically.\r\n\r\nSaj agreed to check it since he is going back to the place  to complete the backup installation.'),
	(26, '032426', 1, 6089, NULL, NULL, ' Backup system only providing power to garage', NULL, 'normal', 'closed', 0, 0, 13, '2024-03-14 12:16:20', '2025-05-28 08:54:41', 'Client called that backup works but only providing power to the garage. \r\n\r\nAli Akbar is the installer.'),
	(32, '032432', 1, 4460, NULL, NULL, 'GRID-INTF', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-18 18:44:43', '2024-06-21 04:32:34', 'GRID-INTF – indicates that there will be issue on the grid side of inverter, this includes checking full AC connection and checking the earth leakage to PV, because it there is current leaking into earth it will cause interference, because PV and AC are s'),
	(37, '032437', 1, 3814, NULL, NULL, 'Error 35', NULL, 'normal', 'resolved', 0, 0, 13, '2024-03-20 13:48:22', '2024-08-01 02:16:39', 'Warranty submited\r\nReference:  CA-APAC-00059887'),
	(38, '032438', 1, 7436, NULL, NULL, 'Battery retrofit requires additional cable', NULL, 'low', 'resolved', 0, 0, 13, '2024-03-24 13:34:02', '2025-05-28 08:36:12', 'Mohammed requires a long cable to install the new battery in the current system because the location of the existing battery doesn\'t have enough room for an additional battery.\r\n\r\nMohammed is not communicating with Syed Raza (energizer tech) to get the ca'),
	(39, '032439', 1, 5739, NULL, NULL, 'Installation Issue (Design- 2 Meters)', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-01 15:00:14', '2024-09-06 09:53:50', 'Sungrow Tech has confirmed that the design and installation are incorrect, and they advised that it\'s possibly the cause of intermittent power issues because of the two smart meters that receive incorrect references, or both meters can cause reference iss'),
	(40, '042440', 1, 7427, NULL, NULL, 'Dongle Installation', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-01 15:32:45', '2024-06-21 04:28:59', 'Client doesn\'t want to install the new dongle replacement that was sent to him so we arranged Nash to assist him with the installation and it\'s confirmed this coming 11th April 2024.'),
	(41, '042441', 1, 3280, NULL, NULL, 'System Issue? Zeverlution 4000', NULL, 'low', 'closed', 0, 0, 13, '2024-04-03 13:54:28', '2024-09-06 09:52:56', 'Client Called about issue- \r\nNeed a call back 0417787598'),
	(42, '042442', 1, 7447, NULL, NULL, 'PV1 String No Production', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-03 15:20:40', '2024-06-21 04:24:16', 'Confirmed with Online monitoring that his PV1 is not generating.\r\n\r\nInstaller is Levi Van voorthuizen (Jonathan Clack)'),
	(43, '042443', 1, 5870, NULL, NULL, 'Inverter Dongle issue', NULL, 'low', 'on_hold', 0, 0, 13, '2024-04-04 15:40:58', '2024-07-01 00:58:57', 'Adam is aware, dongle is damaged by the installer.\r\n\r\nInstaller doesn\'t want to go back.\r\n\r\nNeeds Adams decision.'),
	(52, '042452', 1, 4974, NULL, NULL, 'Inverter And Battery Replacement', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-04 18:34:48', '2025-05-28 08:38:33', 'Inverter and battery are replaced, the faulty units needs to be collected.'),
	(53, '042453', 1, 2672, NULL, NULL, 'New Battery Installed causing system issues', NULL, 'high', 'resolved', 0, 0, 13, '2024-04-07 16:14:56', '2025-05-28 08:59:19', 'After the RedX battery was installed, the existing battery and inverter is showing 6 errors and it causes the existing system to stop working.\r\n\r\nError Codes;\r\n005\r\n010\r\n014\r\n084\r\n703\r\n735'),
	(54, '042454', 1, 7458, NULL, NULL, 'Backup Circuit and Changeover Switch', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-07 17:49:13', '2024-06-21 04:24:12', 'He has informed us that his fridge is not connected to the EPS and he\'s requesting a changeover switch for his hot water service.\r\n\r\nAdditionally, he mentioned that all other power points are connected to the EPS except for the fridge.'),
	(55, '042455', 1, 6417, NULL, NULL, 'High Electricity Bills', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-07 20:24:24', '2025-05-28 08:58:44', 'Client have two phase power with two rate metering.\r\n\r\nNeed advise from Adam about this setup.'),
	(56, '042456', 1, 2623, NULL, NULL, 'Online Montioring account not working', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-08 15:27:44', '2024-06-21 04:21:08', 'Client has zeversolar and zeversolar platform has merged with Solplanet.\r\n\r\nSent client a guide on how to reset the password using the Solplanet website.'),
	(58, '042458', 1, 7014, NULL, '66DH50201A7N007', 'Battery Faulty', NULL, 'high', 'resolved', 0, 0, 13, '2024-04-08 19:13:25', '2024-06-21 04:20:47', 'Kenneth confirmed that the battery is faulty and needs to be replaced last Feb 14'),
	(59, '042459', 1, 7090, NULL, NULL, 'Firmware Update Required', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-08 19:54:18', '2024-06-21 04:00:32', 'Battery was replaced but requires a manual firmware upgrade.\r\n\r\nFirmware has been forwarded to Max Rowe but stilll waiting for him to get back to me with a date.'),
	(60, '042460', 1, 5833, NULL, NULL, 'Backup Issue', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-09 14:47:39', '2024-06-21 03:59:38', 'Client has confirmed that the backup is not working.\r\n\r\nSaj the installer advised that he needs to go back to install the changeover switch and fix the backup but no date yet.'),
	(61, '042461', 1, 5674, NULL, NULL, 'GridVoltFault', NULL, 'low', 'on_hold', 0, 0, 13, '2024-04-09 17:19:32', '2024-06-21 03:58:02', 'Belynda reported that her export wasnt approved and she has a high bill.\r\n\r\nMichael Barnett complained to me that the system wasn\'t working for 2 months, which it was never reported. Which I cannot fix or assist if I have no idea.\r\n\r\nMichael Barnett tried'),
	(63, '042463', 1, 2588, NULL, 'R48189P3SBMA171223701', 'LG Battery Recall', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-10 19:45:10', '2024-06-21 03:57:52', 'LG will reimburse us $300.'),
	(64, '042464', 1, 5417, NULL, NULL, 'Dongle Replacement', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-12 00:21:22', '2024-06-21 03:57:39', 'Client paid $99 for a new dongle.\r\n\r\nDongle was dropped off to Au post street posting box yesterday.'),
	(65, '042465', 1, 4960, NULL, 'STE20240402-01097', 'Tesla Gateway Issue', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-12 03:28:31', '2024-06-21 03:57:22', 'Gateway has burn marks.'),
	(66, '042466', 13, 6059, NULL, 'STE20201026-00165', 'Internal Fault Requires Replacement', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-15 00:07:00', '2024-06-21 03:57:16', 'Clients Report: My telstra app shows a fault with powerwall and can l schedule a time to this to be serviced next week on either monday 22 Wednesday 24 Thursday or friday 24 april\r\nFault message on powerwall app.\r\n\r\nTesla Ticket Number: SV018C1510'),
	(68, '042468', 1, 3433, NULL, 'ZD50000111911146', 'Reconnecting Status', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-15 06:22:52', '2024-06-21 03:56:05', 'Client reported that the system is showing reconnecting. We tried turning off and on the system but the reconnecting status reappears. After the reboot the system back to normal but shows reconnecting after a minute or two.'),
	(69, '042469', 1, 7489, NULL, 'ALD011123080018', 'Battery Not working since installation', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-18 02:35:46', '2024-06-21 03:55:47', 'Spoke with Alan and guided him on how to switch on the system but we failed.\r\n\r\nAlan also advised that the system was signed off by the inspector even the battery wasn\'t turning on.\r\n\r\nsent information to will (installer) and wainting for his response.'),
	(70, '042470', 1, 7312, NULL, NULL, 'Battery has fault', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-19 02:01:31', '2025-05-28 08:39:27', 'Hinal~~~ This customer\'s battery is displaying a fault. I informed him that you will follow up with them on Monday.'),
	(71, '042471', 1, 5399, NULL, '7418225F-0D', 'Inverter production issue detected', NULL, 'low', 'resolved', 0, 0, 13, '2024-04-19 03:58:40', '2024-10-29 09:55:24', 'Inverter - Production issue detected. There\'s a production but very low.'),
